import adapter from './adapter'


let listOfStreams = adapter.getStreams()
.then(streamsList => streamsList)

let streams = [];

const data = {

  pushStreams: () => { 
    listStreams.forEach(stream=> {
     streams.push(stream)
    })
  },


}

export default data;
